import {FloatingLabel, Form} from 'react-bootstrap'


export const FloatingLabelsPassword = (props) => {

   return <>

        <FloatingLabel
            controlId="floatingInput"
            label={props.name}
            className="mb-3"
        >
            
            <Form.Control 
                type="password" 
                name={props.name}
                placeholder=" " 
                value = {props.val}
                onChange={props.handleChange}
            />

        </FloatingLabel>

    </>
}
